import React from 'react';
import ReactDOM from 'react-dom';
import Home from './Home';
import Default from './Default';
import Gettest from './Gettest';
import Login from './Login';
import Registration from './Registration';
import testHome from './testHome';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";




ReactDOM.render(
	<BrowserRouter>

        <Route path='/default/:data' caseSensitive={false} element={<Default />} />
        <Route path='/gettest/:data' caseSensitive={false} element={<Gettest />} />
        <Route path='/register' caseSensitive={false} element={<testHome />} />
        <Route path='/' caseSensitive={false} element={<Home />} />
        <Route path='/Home/:data' caseSensitive={false} element={<Home />} />
        <Route path='/login' caseSensitive={false} element={<Login />} />
        <Route path='/registration' caseSensitive={false} element={<Registration />} />
        <Route path='/test' caseSensitive={false} element={<test />} />

    </BrowserRouter>,

	document.getElementById('root'));
